        (-x[2],x[0],-y[1],-z[2],-z[1],), # 0-1-0----00-
        (x[0],y[1],y[0],-z[2],), # --1-11---0--
        (x[2],y[2],-z[4],), # 1--1---0----
        (y[1],y[0],-z[1],), # ----11----0-
        (x[1],y[1],-z[5],), # -1--1-0-----
