        (x[1],-y[1],z[1],-z[0],), # -1--0-----10
        (-y[2],-y[1],-z[3],-z[0],), # ---00---0--0
        (-x[2],-x[0],-z[4],z[2],z[0],), # 0-0----0-1-1
        (-x[2],-y[2],-z[2],-z[0],), # 0--0-----0-0
        (y[1],-z[5],z[0],), # ----1-0----1
        (-x[1],-y[1],z[4],z[3],z[2],), # -0--0--111--
        (x[1],-z[5],z[0],), # -1----0----1
        (-x[1],-x[0],-y[2],-y[1],-z[2],-z[1],), # -0000----00-
