        (-x[1],-y[2],z[5],z[4],z[3],), # -0-0--111---
        (x[1],-y[1],-z[4],z[3],), # -1--0--01---
        (-y[2],-y[0],-z[4],z[2],-z[1],), # ---0-0-0-10-
        (-x[1],-y[0],z[1],z[0],), # -0---0----11
        (-x[0],-y[1],z[1],z[0],), # --0-0-----11
        (-x[1],y[1],-z[4],z[3],), # -0--1--01---
        (x[2],y[1],-z[4],), # 1---1--0----
