        (-y[1],-z[6],-z[5],-z[2],-z[0],), # ------0--00--0-0
        (-x[1],-y[2],y[0],z[3],z[2],z[1],), # --0--0-1----111-
        (-x[2],y[1],z[2],-z[1],z[0],), # -0----1------101
