        (y[2],y[0],-z[7],-z[4],z[2],), # -----1-10--0-1--
        (-y[0],-z[7],-z[6],-z[2],), # -------000---0--
        (x[1],y[3],y[1],y[0],-z[3],), # --1-1-11----0---
