        (-x[3],x[0],y[2],z[3],-z[1],), # 0--1-1------1-0-
        (x[3],x[0],-y[2],z[3],-z[1],), # 1--1-0------1-0-
        (-x[3],-x[2],-y[2],-y[1],z[7],-z[5],-z[2],), # 00---00-1-0--0--
